import nltk
import pymorphy3
from nltk.tokenize import sent_tokenize
from nltk.tokenize import word_tokenize
import re

nltk.download('punkt_tab')

# Разбиение на предложения
def split_text_into_sent(text):
  sent_tokens = sent_tokenize(text)
  return sent_tokens

def should_include_word(parsed):
    if parsed.tag.POS in {'PREP', 'CONJ', 'PRCL', 'INTJ', 'NPRO'}:
        return False
    return True

# Разбиение на слова
def split_sent_into_words(sent):
  tokens = word_tokenize(sent)
  words = []

  for token in tokens:
      if re.match(r'^[а-яё]+$', token.lower()):
          words.append(token.lower())

  return words

# Часть речи
def part_of_speech(pos):
  return pos in {'NOUN', 'ADJF', 'ADJS'}

# Совпадение по роду, числу и падежу
def word_form(word1, word2):
    # проверка числа
    if getattr(word1.tag, 'number', None) != getattr(word2.tag, 'number', None):
        return False

    # проверка падежа, если он определен у обоих слов
    case1 = getattr(word1.tag, 'case', None)
    case2 = getattr(word2.tag, 'case', None)
    if case1 and case2 and case1 != case2:
        return False

    # проверка рода, если у одного из слов его нет
    gender1 = getattr(word1.tag, 'gender', None)
    gender2 = getattr(word2.tag, 'gender', None)

    # прилагательные во мн. числе
    if (word1.tag.number == 'plur' and gender1 is None and gender2 is not None):
        return True
    if (word2.tag.number == 'plur' and gender2 is None and gender1 is not None):
        return True

    # проверка рода, если у обоих слов он есть
    if gender1 and gender2 and gender1 != gender2:
        return False

    return True

m = pymorphy3.MorphAnalyzer()

# Нахождение наилучшей пары слов
def get_best_matching_parse(word1, word2):
    parses1 = m.parse(word1)
    parses2 = m.parse(word2)

    for parse1 in parses1:
        for parse2 in parses2:
              if (word_form(parse1, parse2)):
                return parse1, parse2

    return parses1[0], parses2[0]

# Анализ предложения
def analyze_sent(sent):
    pairs = []
    words = split_sent_into_words(sent)
    print(f"Все слова: {words}")

    for i in range(len(words) - 1):
        word1, word2 = words[i], words[i+1]
        w1_temp = m.parse(word1)[0]
        w2_temp = m.parse(word2)[0]

        if not should_include_word(w1_temp) or not should_include_word(w2_temp):
            print(f"Пропускаем пару со служебным словом: '{word1}' + '{word2}'")
            continue

        w1, w2 = get_best_matching_parse(word1, word2)
        print(f"Пара: '{word1}'({w1.tag.POS}) + '{word2}'({w2.tag.POS})")

        if part_of_speech(w1.tag.POS) and part_of_speech(w2.tag.POS):
            print(f"  Подходит по частям речи")
            if word_form(w1, w2):
                print(f"  Совпадает по грамматике - {w1.normal_form} {w2.normal_form}")
                pairs.append((w1.normal_form, w2.normal_form))
            else:
                print(f"  Не совпадает: case={getattr(w1.tag, 'case', 'N/A')}/{getattr(w2.tag, 'case', 'N/A')}, number={getattr(w1.tag, 'number', 'N/A')}/{getattr(w2.tag, 'number', 'N/A')}, gender={getattr(w1.tag, 'gender', 'N/A')}/{getattr(w2.tag, 'gender', 'N/A')}")
    return pairs

# Текст из файла
file = open("/content/drive/MyDrive/универ/4 курс/1 семестр/обработка естесственного языка/лаба1/текст1.txt", "r", encoding='utf-8-sig')
text = file.read()
print(text)
file.close()

sentences = split_text_into_sent(text)
all_pairs = []
for i, sentence in enumerate(sentences, 1):
    sent_pairs = analyze_sent(sentence)
    all_pairs.extend(sent_pairs)
    print(f"\nПары из предложения {i}:")
    for pair in sent_pairs:
        print(f"Пара:  {pair[0]} {pair[1]}")

print("\nВСЕГО ПАР:", len(all_pairs))
for pair in all_pairs:
    print(f"Пара: {pair[0]} {pair[1]}")